import React, { useState } from "react";
import useUserApi from "../../hooks/useUserApi";
import "./Register.css";
const SignInRegister = () => {
  const [isSignIn, setIsSignIn] = useState(false);
  const [users, loading, error] = useUserApi();

  const handleSignInClick = () => {
    setIsSignIn(false);
  };

  const handleSignUpClick = () => {
    setIsSignIn(true);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      // בדיקת תקינות הנתונים
      if (!isValidUserData(userData)) {
        alert("Please enter valid user data.");
        return;
      }

      // ביצוע בקשת POST לשרת עם הנתונים של המשתמש
      const response = await axios.post("/api/register", userData);
      console.log("Response:", response.data);
      alert("User registered successfully!");
      // ניווט לעמוד אחר או טיפול נוסף בהתאם למצב
    } catch (error) {
      console.error("Error registering user:", error.message);
      alert("Failed to register user. Please try again.");
    }
  };

  const isValidUserData = (userData) => {
    const { password, phone, email, image } = userData;
    const passwordRegex =
      /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[!@#$%^&*()-+_={}[\]:;"'<>,.?/|\\])(?=.*[a-zA-Z0-9]).{9,}$/;
    const phoneRegex = /^(0(5[0-9]|7[0-9]|9[0-9]|72|74|76|77|78)([0-9]{7}))$/;
    const emailRegex = /^[\w-]+(\.[\w-]+)*@([\w-]+\.)+[a-zA-Z]{2,7}$/;
    const urlRegex = /^(http|https):\/\/[^ "]+$/;

    return (
      passwordRegex.test(password) &&
      phoneRegex.test(phone) &&
      emailRegex.test(email) &&
      urlRegex.test(image)
    );
  };

  return (
    <div className="body-img">
      <div className={`container ${isSignIn ? "right-panel-active" : ""}`}>
        <div className="container__form container--signup">
          <form
            action="#"
            className="form formScroll"
            id="form1"
            onSubmit={handleSubmit}
          >
            <h2 className="form__title">Sign Up</h2>
            <input type="text" placeholder="User" className="input" />
            <input type="email" placeholder="Email" className="input" />
            <input type="password" placeholder="Password" className="input" />
            <input type="password" placeholder="Password" className="input" />
            <input type="password" placeholder="Password" className="input" />
            <input type="password" placeholder="Password" className="input" />
            <input type="password" placeholder="Password" className="input" />
            <input type="password" placeholder="Password" className="input" />
            <input type="password" placeholder="Password" className="input" />
            <button className="btn">Sign Up</button>
          </form>
        </div>

        <div className="container__form container--signin">
          <form action="#" className="form" id="form2" onSubmit={handleSubmit}>
            <h2 className="form__title">Sign In</h2>
            <input type="email" placeholder="Email" className="input" />
            <input type="password" placeholder="Password" className="input" />
            <button className="btn">Sign In</button>
          </form>
        </div>

        <div className="container__overlay">
          <div className="overlay">
            <div className="overlay__panel overlay--left">
              <button className="btn" id="signIn" onClick={handleSignInClick}>
                Sign In
              </button>
            </div>
            <div className="overlay__panel overlay--right">
              <button className="btn" id="signUp" onClick={handleSignUpClick}>
                Sign Up
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SignInRegister;
